Last Knights (2015)
R | 115 min | Action, Adventure | 3 April 2015 (USA) 

Academy Award (R) Nominee Clive Owen (Best Performance by an Actor in a Supporting Role, Closer, 2004) delivers an electrifying performance as a fallen warrior who rises against a corrupt and sadistic ruler to avenge his dishonored master, Academy Award (R) Winner Morgan Freeman (Best Performance by an Actor in a Supporting Role, Million Dollar Baby, 2004) in this epic, sword-clashing adventure of loyalty, honor, and vengeance. 

Stars: Clive Owen, Morgan Freeman


